    true,nt"url": null,nt"notes": "The San Francisco Department of Public Health
    Flood Health Vulnerability Index is a composite index that measures the spatial
    distribution and relative vulnerability of San Francisco communities to the health
    impacts of flood inundation and extreme storms. The index is constructed using socioeconomic
    and demographic, exposure, health, and housing indicators and is intended to serve
    as a planning tool for health and climate adaptation. Steps for calculating the
    index can be found in in the "An Assessment of San Franciscou2019s Vulnerability
    to Flooding & Extreme Storms" located at https://extxfer.sfdph.org/gis/Flooding/SFDPH_FloodHealthVulnerability2016.pdf.rnrnData
